def _decrypt_str(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_KEY, AES.MODE_CBC, iv).decrypt(p), 16).decode("utf-8", "ignore")

def _decrypt_bytes(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_KEY, AES.MODE_CBC, iv).decrypt(p), 16)

